(1, 36, 'Bicicleta Montanha', 'bicicleta-montanha', '', '<p>.</p>', '', 1, 0, 0, 8, '2015-03-25 18:01:48', 994, '', '2015-03-25 18:04:00', 994, 0, '0000-00-00 00:00:00', '2015-03-25 18:01:48', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/banners\\/3be7de92a0c86622a8d2659ee3cc3891.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 2, 0, 0, '', '', 1, 297, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', ''),
(2, 44, 'Cookie Policy', 'cookie-policy', '', '', '<h1 class=\'uk-article-title\'>Cookies</h1><div><p style=\'text-align: justify;\'>A Cookie file is – according to Wikipedia - a small piece of data sent from a website and stored in a user\'s web browser while a user is browsing a website. When the user browses the same website in the future, the data stored in the cookie can be retrieved by the website to notify the website of the user\'s previous activity. Cookies were designed to be a reliable mechanism for websites to remember the state of the website or activity the user had taken in the past. This can include clicking particular buttons, logging in, or a record of which pages were visited by the user even months or years ago. More information on that topic can be find on Wikipedia.</p><p>Purposes of storage and gaining access to cookies:</p><ul><li>Website personalisation (for example: saving font size, sight challenged version of website or template version)</li><li>Saving data or user’s decisions (for example: no need to enter login and password on every website, remembering login during the next visit, keeping information on products added to cart)</li><li>Social websites integration (for example: displaying your friends, fans or post publishing on Facebook or Google+ directly from the website)</li><li>Adjusting adverts that are display on the website</li><li>Creating website’s statistics and flow statistics between different websites</li></ul><p style=\'text-align: justify;\'>Below one can find links to sources showing how to set the conditions of storage and gaining access to cookies already stored in user’s device for the most popular internet browsers.</p><ul><li>Firefox</li><li>Chrome</li><li>Internet Explorer</li><li>Opera</li><li>Safari</li></ul><p style=\'text-align: justify;\'>Due to vast number of technological solutions it is not possible to publish clear guidelines how to set the conditions of storage and gaining access to cookies using settings of all available devices and software installed on them. However, in most cases, select \"Tools\" or \"Settings\" and there find the section that corresponds to the configuration settings for cookies or for the management of privacy. Detailed information is usually provided by the manufacturer of the device or browser in a manual or on their website.</p></div>', 1, 0, 0, 1, '2016-02-26 14:03:56', 994, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', 1, 0, 0, '', '', 1, 0, '', 0, '', ''),
