(10050, 'TinyMCE - Português de Portugal', 'file', 'file_tinymce_pt-PT', '', 0, 1, 0, 0, '{\"legacy\":false,\"name\":\"TinyMCE - Portugu\\u00eas de Portugal\",\"type\":\"file\",\"creationDate\":\"2012-12-09\",\"author\":\"Comunidade Portuguesa JoomlaPT!\",\"copyright\":\"(C) 2011 - 2012 Comunidade JoomlaPT Portugal\",\"authorEmail\":\"geral@joomlapt.com\",\"authorUrl\":\"www.joomlapt.com\",\"version\":\"3.5.4.1\",\"description\":\"\\n      <h2>Instalou com sucesso o idioma portugu\\u00eas de Portugal para TinyMCE 3.5.4 em Joomla 2.5.x<\\/h2>\\n      <p>Configura\\u00e7\\u00f5es a efetuar no editor TinyMCE:\\n      <ol>\\n      <li>Menu Extens\\u00f5es<\\/li>\\n      <li>Em Gestor de Plugins escolher o editor TinyMCE\\n      <br \\/>ou diretamente aqui: <a href=\\\"index.php?option=com_plugins&view=plugins&filter_search=Editor - TinyMCE\\\">Editor - TinyMCE<\\/a><\\/li>\\n      <li>No editor, alterar as Op\\u00e7\\u00f5es b\\u00e1sicas<\\/li>\\n      <li>Funcionalidades :: COMPLETO\\n      <br \\/>(Opcional -- se pretende utilizar todos os \\u00edcones da barra de ferramentas do TinyMCE)<\\/li>\\n      <li>C\\u00f3digo de idioma :: pt\\n      <br \\/>(em min\\u00fasculas, para ativar idioma padr\\u00e3o pt-PT)<\\/li>\\n      <li>Sele\\u00e7\\u00e3o autom\\u00e1tica de idioma :: SIM \\n      <br \\/>(para ativar idiomas por utilizador)<\\/li>\\n      <\\/ol>\\n      <\\/p>\\n      <p>Se pretende utilizar outros idiomas Joomla, para al\\u00e9m de Ingl\\u00eas e Portugu\\u00eas (de Portugal), instale tamb\\u00e9m esses idiomas para TinyMCE.<br \\/>\\n      Este \\u00e9 um requisito caso pretenda ativar a \\\"Sele\\u00e7\\u00e3o autom\\u00e1tica de idioma\\\" no editor.\\n      <\\/p>\\n      <p><\\/p>\\n      <p>Este pacote de idioma \\u00e9 uma produ\\u00e7\\u00e3o da <a href=\\\"http:\\/\\/www.joomlapt.com\\\" target=\\\"_blank\\\" title=\\\"Comunidade JoomlaPT\\\">Comunidade JoomlaPT Portugal<\\/a><\\/p>\\n      \\n   \",\"group\":\"\"}', '', '', '', 0, '0000-00-00 00:00:00', 0, 0);
