(10051, 'pt-PT', 'package', 'pkg_pt-PT', '', 0, 1, 1, 0, '{\"legacy\":false,\"name\":\"Portugu\\u00eas Europeu\",\"type\":\"package\",\"creationDate\":\"2015-02-02\",\"author\":\"Comunidade JoomlaPT Portugal\",\"copyright\":\"Copyright (C) 2005 - 2015 Open Source Matters. Todos os direitos reservados.\",\"authorEmail\":\"geral@joomlapt.com\",\"authorUrl\":\"http:\\/\\/www.joomlapt.com\",\"version\":\"2.5.28.1\",\"description\":\"\\n      <h2>Instalou com sucesso o idioma portugu\\u00eas de Portugal para Joomla 2.5 <br \\/>Inclui idioma para TinyMCE<\\/h2>\\n      <p>A- Tornar este idioma como padr\\u00e3o no Joomla:<\\/p>\\n      <ol>\\n      <li>Menu Extens\\u00f5es<\\/li>\\n      <li>Em Gestor de Idiomas escolher os idiomas instalados na Administra\\u00e7\\u00e3o<br \\/>ou diretamente aqui: <a href=\\\"index.php?option=com_languages&amp;view=installed&amp;client=1\\\">Gestor de idiomas<\\/a><\\/li>\\n      <li>Separador Administra\\u00e7\\u00e3o: carregar na estrela para tornar este idioma o padr\\u00e3o no interface de administra\\u00e7\\u00e3o<\\/li>\\n      <li>Separador S\\u00edtio: carregar na estrela para tornar este idioma o padr\\u00e3o no interface de s\\u00edtio<\\/li>\\n      <\\/ol>\\n      <p> <\\/p>\\n      <p>B- Configura\\u00e7\\u00f5es a efetuar no editor TinyMCE:<\\/p>\\n      <ol>\\n      <li>Menu Extens\\u00f5es<\\/li>\\n      <li>Em Gestor de Plugins escolher o editor TinyMCE <br \\/>ou diretamente aqui: <a href=\\\"index.php?option=com_plugins&amp;view=plugins&amp;filter_search=Editor - TinyMCE\\\">Editor - TinyMCE<\\/a><\\/li>\\n      <li>No editor, alterar as Op\\u00e7\\u00f5es b\\u00e1sicas<\\/li>\\n      <li>Funcionalidades :: COMPLETO <br \\/>(Opcional -- se pretende utilizar todos os \\u00edcones da barra de ferramentas do TinyMCE)<\\/li>\\n      <li>C\\u00f3digo de idioma :: pt <br \\/>(em min\\u00fasculas, para ativar idioma padr\\u00e3o pt-PT)<\\/li>\\n      <li>Sele\\u00e7\\u00e3o autom\\u00e1tica de idioma :: SIM <br \\/>(para ativar idiomas por utilizador)<\\/li>\\n      <\\/ol>\\n      <p> <\\/p>\\n      <p>Nota: mesmo se n\\u00e3o for o editor padr\\u00e3o \\u00e9 necess\\u00e1rio instalar\\/atualizar o idioma do editor TinyMCE configurando-o para portugu\\u00eas<\\/p>\\n      <p>Se pretende utilizar outros idiomas Joomla, para al\\u00e9m de Ingl\\u00eas e Portugu\\u00eas (de Portugal), instale tamb\\u00e9m os idiomas respetivos para TinyMCE.<br \\/> Este \\u00e9 um requisito caso pretenda ativar a \\\"Sele\\u00e7\\u00e3o autom\\u00e1tica de idioma\\\" no editor.<\\/p>\\n      <p> <\\/p>\\n      <p>Este pacote de idioma \\u00e9 uma produ\\u00e7\\u00e3o da <a href=\\\"http:\\/\\/www.joomlapt.com\\\" target=\\\"_blank\\\" title=\\\"Comunidade JoomlaPT\\\">Comunidade JoomlaPT Portugal<\\/a><\\/p>\\n      <p>Colabore online e corrija erros da tradu\\u00e7\\u00e3o: <a href=\\\"https:\\/\\/www.transifex.com\\/projects\\/p\\/j2corelang\\\" target=\\\"_blank\\\" title=\\\"Tradu\\u00e7\\u00e3o no Transifex\\\">Tradu\\u00e7\\u00e3o em linha - Sistema Transifex<\\/a><\\/p>\\n      \\n\\t\",\"group\":\"\"}', '{}', '', '', 0, '0000-00-00 00:00:00', 0, 0),
