(17, 'Destaques', '', '', '<div class=\"featured col-lg-12\">\r\n	<span class=\"ftype01\"><?php echo JText::_(\'NC_FEATURED\'); ?></span>\r\n	<span class=\"ftype03\"><a href=\"\"><?php echo JText::_(\'NC_SEE_MORE\'); ?></a></span>\r\n</div>\r\n<div class=\"col-lg-12 feat-main\">\r\n	<div class=\"col-lg-12 feat-cont\">\r\n<?php\r\n	$lang = JFactory::getLanguage();\r\n	$db = JFactory::getDbo();\r\n	$query = $db->getQuery(true);\r\n	$query->select(\'*\');\r\n	$query->from($db->quoteName(\'#__content\'));\r\n	$query->where($db->quoteName(\'catid\') . \' = 10\');\r\n	$query->where($db->quoteName(\'state\') . \' = 1\');\r\n	$query->where($db->quoteName(\'language\') . \' = \' . $db->quote($lang->getTag()));\r\n	$query->order(\'created DESC\');\r\n	$db->setQuery($query,0,3);\r\n\r\n	$results = $db->loadObjectList();\r\n\r\n	foreach( $results as $destaque ) {\r\n		$images_news = split(\',\',$destaque->images);\r\n		$images_news = split(\':\',$images_news[0]);\r\n		$images_news = str_replace(\'/\', \'/\', $images_news[1]);\r\n		$images_news = str_replace(\'\"\', \'\', $images_news);\r\n		if(trim($images_news) == \'\') {\r\n			$images_news = \"img/news/square.png\";\r\n		}\r\n	?>\r\n	<a href=\'index.php?option=com_content&view=article&id=<?php echo $destaque->id; ?>\'>\r\n		<div class=\"col-lg-12 feat-cont-img\">\r\n			<img src=\"<?php echo $images_news; ?>\" />\r\n			<div class=\"overlay\"><i class=\"fa fa-search\" aria-hidden=\"true\"></i></div>\r\n		</div>\r\n	</a>\r\n	<?php\r\n	}\r\n?>\r\n	</div>\r\n</div>\r\n', 0, 0, 1),
(3, 'Área Clientes', '', '', '<?php \r\n$lang = JFactory::getLanguage();\r\nif (JFactory::getUser()->id > 0) { ?>\r\n<style>\r\n	.line_div {\r\n		text-align:center;\r\n		width:100%;\r\n		height:150px;\r\n	}\r\n	\r\n	.subline_div {\r\n		float:left;\r\n		width:33%;\r\n		height:100px;\r\n		color:#0062a9;\r\n	}\r\n	\r\n	.subline_div i{\r\n		font-size:3rem;\r\n	}\r\n	\r\n	.rc_blue {\r\n		color:#0062a9;\r\n	}\r\n</style>\r\n\r\n<h2 class=\"rc_blue\">\r\n<?php \r\n	if( $lang->getTag() == \'pt-PT\' )\r\n		echo \"BEM-VINDO \";\r\n	else if( $lang->getTag() == \'en-GB\' )\r\n		echo \"WELCOME \";\r\n	echo JFactory::getUser()->name; \r\n?>\r\n</h2>\r\n<br>\r\n<div class=\"line_div\">\r\n	<div onclick=\"window.location.href = \'index.php?option=com_virtuemart&view=user\';\" class=\"subline_div hvr-float-shadow\">\r\n		<i class=\"fa fa-user\"></i><br><br>\r\n		<?php\r\n		if( $lang->getTag() == \'pt-PT\' )\r\n			echo \"Dados Gerais\";\r\n		else if( $lang->getTag() == \'en-GB\' )\r\n			echo \"General Data\";\r\n		?>\r\n	</div>\r\n	<div onclick=\"window.location.href = \'index.php?option=com_virtuemart&view=orders&layout=list\';\" class=\"subline_div hvr-float-shadow\">\r\n		<i class=\"fa fa-cart-arrow-down\"></i><br><br>\r\n		<?php\r\n		if( $lang->getTag() == \'pt-PT\' )\r\n			echo \"Encomendas\";\r\n		else if( $lang->getTag() == \'en-GB\' )\r\n			echo \"Orders\";\r\n		?>\r\n	</div>\r\n	<?php \r\n	if ( $lang->getTag() == \'pt-PT\' ) \r\n	{ \r\n		$downloads_text = \"ficheiros\"; \r\n	} \r\n	else if ( $lang->getTag() == \'en-GB\' ) \r\n	{ \r\n		$downloads_text = \"files\"; \r\n	} \r\n	?>\r\n	<div onclick=\"window.location.href = \'<?php echo $downloads_text; ?>\';\" class=\"subline_div hvr-float-shadow\"><i class=\"fa fa-download\">\r\n		</i><br><br>\r\n		Downloads\r\n	</div>\r\n</div>\r\n<div class=\"line_div\">\r\n	<?php \r\n	if ( $lang->getTag() == \'pt-PT\' ) \r\n	{ \r\n		$propos_text = \"propostas\"; \r\n	} \r\n	else if ( $lang->getTag() == \'en-GB\' ) \r\n	{ \r\n		$propos_text = \"proposals\"; \r\n	} \r\n	?>\r\n	<div onclick=\"window.location.href = \'<?php echo $propos_text; ?>\';\" class=\"subline_div hvr-float-shadow\">\r\n		<i class=\"fa fa-pencil\"></i><br><br>\r\n		<?php\r\n		if( $lang->getTag() == \'pt-PT\' )\r\n			echo \"Propostas\";\r\n		else if( $lang->getTag() == \'en-GB\' )\r\n			echo \"Proposals\";\r\n		?>\r\n	</div>\r\n\r\n	<form action=\"\" method=\"post\" id=\"login-form\" style=\"padding:0;\">\r\n		<div onclick=\"javascript:this.parentNode.submit();\" class=\"subline_div hvr-float-shadow\">\r\n			<i class=\"fa fa-power-off\"></i><br><br>\r\n			<?php echo JText::_(\'JLOGOUT\'); ?>\r\n			<input type=\"hidden\" name=\"option\" value=\"com_users\" />\r\n			<input type=\"hidden\" name=\"task\" value=\"user.logout\" />\r\n			<input type=\"hidden\" name=\"return\" value=\"<?php echo $return; ?>\" />\r\n			<?php echo JHtml::_(\'form.token\'); ?>\r\n		</div>\r\n	</form>\r\n\r\n</div>\r\n<?php } \r\n	else { \r\n		if( $lang->getTag() == \'pt-PT\' )\r\n			echo \"<a>Tem de efetuar login para aceder a esta área</a>\";\r\n		else if( $lang->getTag() == \'en-GB\' )\r\n			echo \"You must log in to access this area\";\r\n	?>\r\n<?php }\r\n?>', 0, 0, 1),
(9, 'Novos Produtos', '', '', '<?php \r\n\r\n	$language =& JFactory::getLanguage();\r\n	$language->load(\'mod_virtuemart_product\');\r\n\r\n	$db = JFactory::getDbo();\r\n	$sql = \"\";\r\n	\r\n	$sql .= \"select \";\r\n	$sql .= \"	A.product_sku, \";\r\n	$sql .= \"	MAX(B.product_name) product_name, \";\r\n	$sql .= \"	MAX(A.virtuemart_product_id) virtuemart_product_id, \";\r\n	$sql .= \"	B.slug, \";\r\n	$sql .= \"	ifnull(D.file_url, \'images/logo_256_322.png\') file_url, \";\r\n	$sql .= \"	A.created_on \";\r\n	$sql .= \"from #__virtuemart_products A \";\r\n	$sql .= \"	inner join #__virtuemart_products_\".str_replace(\'-\', \'_\', strtolower(strval($language->getTag()))).\" B on A.virtuemart_product_id = B.virtuemart_product_id \";\r\n	$sql .= \"	left join #__virtuemart_product_medias C on B.virtuemart_product_id = C.virtuemart_product_id \";\r\n	$sql .= \"	left join #__virtuemart_medias D on C.virtuemart_media_id = D.virtuemart_media_id \";\r\n	$sql .= \"where \";\r\n	$sql .= \"	A.published = 1 \";\r\n	$sql .= \"group by \";\r\n	$sql .= \"	A.product_sku \";\r\n	$sql .= \"order by A.created_on desc \";\r\n	$sql .= \"limit 10\";\r\n	\r\n	$db->setQuery($sql);  \r\n	$result = $db->loadObjectList();\r\n	\r\n?>\r\n	<script>\r\n		function gethref(obj) {\r\n			return obj.attr(\"href\");\r\n		}\r\n	</script>\r\n	\r\n	<div class=\"featured-slider\">\r\n		<div class=\"new_title center\">\r\n			<h2><span><a href=\"products/neue-artikel.html\"><?php echo JText::_(\'MOD_VIRTUEMART_PRODUCT_NEW_PRODUCTS\'); ?></a></span></h2>\r\n			<a href=\"products/neue-artikel.html\"><span class=\"linktocat\"><?php echo JText::_(\'MOD_VIRTUEMART_PRODUCT_SHOW_ALL\'); ?></span></a>\r\n		</div>\r\n		<a id=\"products_slider_prev2\" class=\"jcarousel-prev-horizontal2\" href=\"#\"></a> <a id=\"products_slider_next2\" class=\"jcarousel-next-horizontal2\" href=\"#\"></a>\r\n		<div class=\"jcarousel-skin-tango5\">\r\n			<div class=\"jcarousel-container jcarousel-container-horizontal\" style=\"position: relative; display: block;\">\r\n				<div class=\"jcarousel-clip jcarousel-clip-horizontal\" style=\"overflow: hidden; position: relative;\">\r\n					<ul id=\"featured_products_slider2\" class=\"products-grid jcarousel-list jcarousel-list-horizontal\" style=\"overflow: hidden; position: relative; top: 0px; margin: 0px; padding: 0px; left: 0px; width: 2460px;\">\r\n						<?php\r\n							foreach ($result as $row) {\r\n						?>\r\n						<li class=\"item jcarousel-item jcarousel-item-horizontal jcarousel-item-1 jcarousel-item-1-horizontal first1\">\r\n							<div class=\"item-inner\">\r\n								<div class=\"item-img\">\r\n									<div class=\"item-img-info\">\r\n										<a href=\"<?php echo JURI::base().\'index.php/component/virtuemart/\'.$row->slug.\'-detail\'?>\" title=\"<?php echo $row->product_name ?>\" class=\"product-image\"><img src=\"<?php echo $row->file_url ?>\" alt=\"<?php echo $row->product_name ?>\" /></a>\r\n										<div class=\"item-box-hover\">\r\n											<div class=\"box-inner\">\r\n												<div class=\"product-detail-bnt\">\r\n													<a data-fancybox-type=\"ajax\" href=\"<?php echo JURI::base().\'index.php/component/virtuemart/\'.$row->slug.\'-detail\'?>\" onclick=\"callQuickView(\'<?php echo JURI::base()?>quickview.php?id=<?php echo $row->virtuemart_product_id?>\'); return false;\" title=\"<?php echo JText::_(\'MOD_VIRTUEMART_QUICKVIEW\'); ?>\" class=\"button detail-bnt\"><span><?php echo JText::_(\'MOD_VIRTUEMART_QUICKVIEW\'); ?></span></a>\r\n												</div>\r\n											</div>\r\n										</div>\r\n									</div>\r\n								</div>\r\n								<div class=\"item-info\">\r\n									<div class=\"info-inner\">\r\n										<div class=\"item-title\">\r\n											<a href=\"<?php echo JURI::base().\'index.php/component/virtuemart/\'.$row->slug.\'-detail\" title=\"\'.$row->product_name ?>\"><?php echo $row->product_name ?></a>\r\n										</div>\r\n										<div class=\"item-content\">\r\n											<div class=\"ratings\">\r\n												<div class=\"rating-box\">\r\n													<div style=\"width:0%\" class=\"rating\"></div>\r\n												</div>\r\n											</div>\r\n											<div class=\"item-price\"></div>\r\n										</div>\r\n									</div>\r\n									<div class=\"actions\">\r\n										<span class=\"add-to-links\">\r\n											<button type=\"button\" href=\"<?php echo JURI::base().\'index.php/component/virtuemart/\'.$row->slug.\'-detail\" title=\"\'.$row->product_name ?>\" title=\"<?php echo JText::_(\'MOD_VIRTUEMART_DETAILS\'); ?>\" class=\"button btn-cart\" onclick=\"javascript:location.href=gethref(jQuery(this))\"><span><?php echo JText::_(\'MOD_VIRTUEMART_DETAILS\'); ?></span></button>\r\n										</span>\r\n									</div>\r\n								</div>\r\n							</div>\r\n						</li>\r\n						<?php\r\n							}\r\n						?>\r\n					</ul>\r\n				</div>\r\n			</div>\r\n		</div>\r\n	</div>\r\n	\r\n	<script type=\"text/javascript\">\r\n		jQuery(document).ready(function($) {\r\n		\r\n		function mycarousel_initCallback(carousel) {\r\n		\r\n		$(\'#products_slider_next2\').bind(\'click\', function() {\r\n		carousel.next();\r\n		return false;\r\n		});\r\n		$(\'#products_slider_prev2\').bind(\'click\', function() {\r\n		carousel.prev();\r\n		return false;\r\n		});\r\n		};\r\n		\r\n		$(\'#featured_products_slider2\').jcarousel({\r\n		scroll: 1,\r\n		initCallback: mycarousel_initCallback,\r\n		buttonNextHTML: null,\r\n		buttonPrevHTML: null\r\n		});\r\n		});\r\n	</script>\r\n	<div id=\"mgkquickview\">\r\n		<div id=\"magikloading\" style=\"display:none;text-align:center;margin-top:400px;\"><img src=\"images/mgkloading.gif\" alt=\"loading\"></div>\r\n	</div>\r\n	<script type=\"text/javascript\">\r\n		function callQuickView(qurl) { \r\n			jQuery(\'#mgkquickview\').show();\r\n			jQuery(\'#magikloading\').show();\r\n			jQuery.get(qurl, function(data) {\r\n				jQuery.fancybox(data);\r\n				jQuery(\'#magikloading\').hide();\r\n				jQuery(\'#mgkquickview\').hide();\r\n			});\r\n		}\r\n		\r\n	</script>', 0, 0, 1),
