(11, 'Menu Categorias', '', '', '<?php\r\n\r\n	$db = JFactory::getDbo();\r\n	$cur_cat_id = JRequest::getInt(\'virtuemart_category_id\');\r\n	$language = JFactory::getLanguage();\r\n	$language->load(\'mod_virtuemart_product\');\r\n	\r\n	$max_deep = 6;\r\n	$root_found = 0;\r\n	$cur_deep = 0;\r\n	$root_id = 0;\r\n	$categories_parent = array();\r\n	$categories_parent2 = array();\r\n	\r\n	$sql = \"SELECT virtuemart_category_id FROM #__virtuemart_categories where phc_ref = \'PRODUTOS\'\";\r\n	$db->getQuery(true);\r\n	$db->setQuery($sql);\r\n	$result = $db->loadObjectList();\r\n	if( sizeof($result) > 0 ) {\r\n		$root_id = $result[0]->virtuemart_category_id;\r\n	}\r\n\r\n	if( $cur_cat_id == $root_id ) {\r\n		$root_found = 1;\r\n	}\r\n	\r\n	$categories_parent = array($cur_cat_id);\r\n	$categories_parent2 = array($cur_cat_id);\r\n	\r\n	while( !$root_found && $cur_deep < $max_deep) {\r\n		$query = $db->getQuery(true);\r\n		\r\n		$sql = \"\r\n			select category_parent_id\r\n			from #__virtuemart_category_categories \r\n			where category_child_id = $cur_cat_id\r\n			\";\r\n		$db->setQuery($sql);\r\n		$result = $db->loadObjectList();\r\n		\r\n		if( sizeof($result) > 0 ) {\r\n			$par_id = $result[0]->category_parent_id;\r\n			if($par_id<>0) {\r\n				array_unshift($categories_parent, $par_id);\r\n				array_unshift($categories_parent2, $par_id);\r\n			}\r\n			$cur_cat_id = $par_id;\r\n			\r\n			if($par_id == $root_id || $par_id == 0) {\r\n				$root_found = 1;\r\n			}\r\n		}\r\n		$cur_deep++;\r\n	}\r\n	\r\n	$cur_cat_id = JRequest::getInt(\'virtuemart_category_id\');\r\n?>\r\n<style>\r\n	.cat-menu {\r\n		border: 1px solid #ddd;\r\nborder-radius: 0px\r\n	}\r\n	.cat-menu .list-group-item{\r\n		border: 0px;\r\n	}\r\n	.cat-menu .list-group {\r\n		margin-bottom:0;\r\n	}\r\n	.cat-menu .list-group-item {\r\n		border-top: 1px solid #ddd;\r\n	}\r\n	\r\n	.list-group > .list-group > .list-group > a {\r\n		padding-left: 60px;\r\n	}\r\n	\r\n	<?php\r\n		for($i = 1; $i < sizeof($categories_parent2); $i++){\r\n			echo \".list-group \";\r\n			echo str_repeat(\"> .list-group \", $i);\r\n			echo \" > a {\";\r\n			echo \"padding-left: \" . 30*$i . \"px;\";\r\n			echo \"}\";\r\n			echo \"\r\n			\";\r\n		}\r\n	?>\r\n</style>\r\n<div class=\"col-lg-12 nopadding\" style=\'margin-bottom:10px;\'>\r\n	<div class=\"panel nopadding list-group cat-menu\">\r\n	<a class=\"list-group-item\" style=\'background:#fee202; border-radius: 0px;\'><span class=\"ftype01\"><?php echo JText::_(\'NC_CATEGORIES\'); ?></span></a>\r\n<?php\r\n	\r\n	// $f = fopen(\"tiago.txt\", \"a\");\r\n	// fwrite($f, print_r($categories_parent, true));\r\n	// fclose($f);\r\n	$last_str = \"\";\r\n	for($i = 0; $i < sizeof($categories_parent2); $i++){\r\n		$catt = $categories_parent[sizeof($categories_parent)-1];\r\n		array_pop($categories_parent);\r\n		\r\n		$sql = \"select B.category_name, B.slug, B.virtuemart_category_id \";\r\n		$sql .= \"from #__virtuemart_categories A \";\r\n		$sql .= \"inner join #__virtuemart_categories_\" . strtolower(str_replace(\"-\", \"_\", $language->getTag())) . \" B on A.virtuemart_category_id = B.virtuemart_category_id \";\r\n		$sql .= \"inner join #__virtuemart_category_categories C on A.virtuemart_category_id = C.category_child_id \";\r\n		$sql .= \"where C.category_parent_id = $catt and A.published = 1 \";\r\n		$sql .= \"order by B.category_name\";\r\n		\r\n		$db->getQuery(true);\r\n		$db->setQuery($sql);  \r\n		$result = $db->loadObjectList();\r\n		\r\n		$last_str2 = $last_str;\r\n		$last_str = \"\";\r\n		\r\n		foreach( $result as $row ) {\r\n			if(in_array($row->virtuemart_category_id, $categories_parent2) || $row->virtuemart_category_id == $cur_cat_id) {\r\n				$last_str .= \'<a style=\"font-weight:bold;  href=\"index.php/component/virtuemart/\'.$row->slug.\'\" class=\"list-group-item\">\'.$row->category_name.\'</a>\';\r\n				if($last_str2<>\"\")\r\n					$last_str .= \'<div class=\"list-group\">\'.$last_str2.\'</div>\';\r\n			}\r\n			else {\r\n				$last_str .= \'<a href=\"index.php/component/virtuemart/\'.$row->slug.\'\" class=\"list-group-item\">\'.$row->category_name.\'</a>\';\r\n			}\r\n		}\r\n	}\r\n	echo $last_str;\r\n?>\r\n	</div>\r\n</div>\r\n\r\n', 0, 0, 1),
(16, 'Contatos', '', '', '<style>\r\n.panel {\r\n    margin-bottom: 20px;\r\n    background-color: #fff;\r\n    border: 1px solid #ddd;\r\n    border-radius: 0px;\r\n    -webkit-box-shadow: 0 1px 1px rgba(0,0,0,0.05);\r\n    box-shadow: 0 1px 1px rgba(0,0,0,0.05);\r\n}\r\n\r\n.panel-heading {\r\n    padding: 10px 15px; \r\n    background-color: #f5f5f5; \r\n    border-bottom: 1px solid #ddd;\r\n    border-top-right-radius: 3px;\r\n    border-top-left-radius: 3px;\r\n}\r\n\r\n</style>\r\n\r\n<link href=\"http://netdna.bootstrapcdn.com/font-awesome/3.2.1/css/font-awesome.min.css\" rel=\"stylesheet\">\r\n\r\n\r\n<?php \r\n	$lang = JFactory::getLanguage();\r\n?>\r\n\r\n<?php\r\n	if( $lang->getTag() == \'pt-PT\' ) {\r\n?>\r\n	<script src=\'https://www.google.com/recaptcha/api.js\'></script>\r\n<?php\r\n	}\r\n	else if( $lang->getTag() == \'en-GB\' ) {\r\n?>\r\n	<script src=\'https://www.google.com/recaptcha/api.js?hl=en\'></script>\r\n<?php\r\n	}\r\n\r\n	$enviadocomsucesso=0;\r\n	if(isset( $_POST[\'submit\'] )) {\r\n		$captcha=$_POST[\'g-recaptcha-response\'];\r\n		if(!empty($captcha)) {\r\n			$errMsg= \'\';\r\n			$google_url=\"https://www.google.com/recaptcha/api/siteverify\";\r\n			$secret=\"6LeFwB8TAAAAAL9vN5VWi_cDO73ImjXTCbnDnT3n\";\r\n			$ip=$_SERVER[\'REMOTE_ADDR\'];\r\n			$captchaurl=$google_url.\"?secret=\".$secret.\"&response=\".$captcha.\"&remoteip=\".$ip;\r\n			\r\n			$curl_init = curl_init();\r\n			curl_setopt($curl_init, CURLOPT_URL, $captchaurl);\r\n			curl_setopt($curl_init, CURLOPT_RETURNTRANSFER, 1);\r\n			curl_setopt($curl_init, CURLOPT_TIMEOUT, 10);\r\n			$results = curl_exec($curl_init);\r\n			curl_close($curl_init);\r\n			\r\n			$results= json_decode($results, true);\r\n			if($results[\'success\']){\r\n				$enviadocomsucesso=1;\r\n				//send email\r\n				$to = \"\";\r\n				$dep = \"\";\r\n				\r\n				switch ($_POST[\'dep\']) {\r\n					case \"log\":\r\n						$dep = \"Logistica\";\r\n						$to = \"tiago@prototype.pt\";\r\n						break;\r\n					case \"fac