(12, 'Formulario_Registo_PT', '', '', '<style>\r\n.panel {\r\n    margin-bottom: 20px;\r\n    background-color: #fff;\r\n    border: 1px solid #ddd;\r\n    border-radius: 4px;\r\n    -webkit-box-shadow: 0 1px 1px rgba(0,0,0,0.05);\r\n    box-shadow: 0 1px 1px rgba(0,0,0,0.05);\r\n}\r\n\r\n.panel-heading {\r\n    padding: 10px 15px; \r\n    background-color: #f5f5f5; \r\n    border-bottom: 1px solid #ddd;\r\n    border-top-right-radius: 3px;\r\n    border-top-left-radius: 3px;\r\n}\r\n\r\n</style>\r\n\r\n<link href=\"http://netdna.bootstrapcdn.com/font-awesome/3.2.1/css/font-awesome.min.css\" rel=\"stylesheet\">\r\n<script>\r\n	function validateEmail(email) {\r\n		var re = /[A-Z0-9._%+-]+@[A-Z0-9.-]+.[A-Z]{2,4}/igm;\r\n		return re.test(email);\r\n	}\r\n	\r\n	function ValidaDados() {\r\n		var failed = 0;\r\n		jQuery(\".required-entry\").each(function(i, obj) {\r\n			if( jQuery(this).attr(\"name\")==\"email\" ) {\r\n				if( !validateEmail(jQuery(this).val()) ) {\r\n					jQuery(this).css(\"border-color\", \"red\");\r\n					failed = 1;\r\n				}\r\n				else {\r\n					jQuery(this).css(\"border-color\", \"#f0f0f0\");\r\n				}\r\n			}\r\n			else {\r\n				if( jQuery(this).val().trim().length == 0 ) {\r\n					jQuery(this).css(\"border-color\", \"red\");\r\n					failed = 1;\r\n				}\r\n				else {\r\n					jQuery(this).css(\"border-color\", \"#f0f0f0\");\r\n				}\r\n			}\r\n		});\r\n		\r\n		if(failed==0)\r\n			jQuery( \"#form-validate\" ).submit();\r\n	}\r\n</script>\r\n\r\n<?php \r\n	$lang = JFactory::getLanguage();\r\n	if( $lang->getTag() == \'pt-PT\' ) {\r\n?>\r\n	<script src=\'https://www.google.com/recaptcha/api.js\'></script>\r\n<?php\r\n	}\r\n	else if( $lang->getTag() == \'en-GB\' ) {\r\n?>\r\n	<script src=\'https://www.google.com/recaptcha/api.js?hl=en\'></script>\r\n<?php\r\n	}\r\n\r\n	$enviadocomsucesso=0;\r\n	if(isset( $_POST[\'submit\'] )) {\r\n		$captcha=$_POST[\'g-recaptcha-response\'];\r\n		if(!empty($captcha)) {\r\n			$errMsg= \'\';\r\n			$google_url=\"https://www.google.com/recaptcha/api/siteverify\";\r\n			$secret=\"6LeFwB8TAAAAAL9vN5VWi_cDO73ImjXTCbnDnT3n\";\r\n			$ip=$_SERVER[\'REMOTE_ADDR\'];\r\n			$captchaurl=$google_url.\"?secret=\".$secret.\"&response=\".$captcha.\"&remoteip=\".$ip;\r\n			\r\n			$curl_init = curl_init();\r\n			curl_setopt($curl_init, CURLOPT_URL, $captchaurl);\r\n			curl_setopt($curl_init, CURLOPT_RETURNTRANSFER, 1);\r\n			curl_setopt($curl_init, CURLOPT_TIMEOUT, 10);\r\n			$results = curl_exec($curl_init);\r\n			curl_close($curl_init);\r\n			\r\n			$results= json_decode($results, true);\r\n			if($results[\'success\']){\r\n				$enviadocomsucesso=1;\r\n				//send email\r\n				// $to       = \'info@racingcycle.net\';\r\n				$to       = \'tiago.loureiro@novoscanais.pt\';\r\n				$subject  = \'Novo Registo - Loja Online PROTOTYPE\';\r\n				\r\n				$message  = \'<head><link href=\"https://fonts.googleapis.com/css?family=Open+Sans\" rel=\"stylesheet\" type=\"text/css\"><style>* {font-family: \"Open Sans\", sans-serif;}</style></head>\';\r\n				$message .= \'Viva,<br>Foi enviada uma mensagem a partir do sítio <b><i>PROTOTYPE.PT</i></b> com a seguinte informação:\';\r\n				$message .= \'<br><br>\';\r\n				$message .= \'<b>Nome:</b> \' . $_POST[\'name\'];\r\n				$message .= \'<br><br>\';\r\n				$message .= \'<b>Email:</b> \' . $_POST[\'email\'];\r\n				$message .= \'<br><br>\';\r\n				$message .= \'<b>Nº Contribuinte:</b> \' . $_POST[\'taxvat\'];\r\n				$message .= \'<br><br>\';\r\n				$message .= \'<b>Homepage:</b> \' . $_POST[\'homepage\'];\r\n				$message .= \'<br><br>\';\r\n				$message .= \'<b>Telefone:</b> \' . $_POST[\'phone\'];\r\n				$message .= \'<br><br>\';\r\n				$message .= \'<b>Telemóvel:</b> \' . $_POST[\'mobilephone\'];\r\n				$message .= \'<br><br>\';\r\n				$message .= \'<b>Morada:</b> \' . $_POST[\'street\'];\r\n				$message .= \'<br><br>\';\r\n				$message .= \'<b>Cód. Postal:</b> \' . $_POST[\'postcode\'];\r\n				$message .= \'<br><br>\';\r\n				$message .= \'<b>Cidade:</b> \' . $_POST[\'c