.google.com/recaptcha/api/siteverify\";\r\n			$secret=\"6LeFwB8TAAAAAL9vN5VWi_cDO73ImjXTCbnDnT3n\";\r\n			$ip=$_SERVER[\'REMOTE_ADDR\'];\r\n			$captchaurl=$google_url.\"?secret=\".$secret.\"&response=\".$captcha.\"&remoteip=\".$ip;\r\n			\r\n			$curl_init = curl_init();\r\n			curl_setopt($curl_init, CURLOPT_URL, $captchaurl);\r\n			curl_setopt($curl_init, CURLOPT_RETURNTRANSFER, 1);\r\n			curl_setopt($curl_init, CURLOPT_TIMEOUT, 10);\r\n			$results = curl_exec($curl_init);\r\n			curl_close($curl_init);\r\n			\r\n			$results= json_decode($results, true);\r\n			if($results[\'success\']){\r\n				$enviadocomsucesso=1;\r\n				//send email\r\n				// $to       = \'info@racingcycle.net\';\r\n				$to       = \'tiago.loureiro@novoscanais.pt\';\r\n				$subject  = \'Novo Registo - Loja Online PROTOTYPE\';\r\n				\r\n				$message  = \'<head><link href=\"https://fonts.googleapis.com/css?family=Open+Sans\" rel=\"stylesheet\" type=\"text/css\"><style>* {font-family: \"Open Sans\", sans-serif;}</style></head>\';\r\n				$message .= \'Viva,<br>Foi enviada uma mensagem a partir do sítio <b><i>PROTOTYPE.PT</i></b> com a seguinte informação:\';\r\n				$message .= \'<br><br>\';\r\n				$message .= \'<b>Nome:</b> \' . $_POST[\'name\'];\r\n				$message .= \'<br><br>\';\r\n				$message .= \'<b>Email:</b> \' . $_POST[\'email\'];\r\n				$message .= \'<br><br>\';\r\n				$message .= \'<b>Nº Contribuinte:</b> \' . $_POST[\'taxvat\'];\r\n				$message .= \'<br><br>\';\r\n				$message .= \'<b>Homepage:</b> \' . $_POST[\'homepage\'];\r\n				$message .= \'<br><br>\';\r\n				$message .= \'<b>Telefone:</b> \' . $_POST[\'phone\'];\r\n				$message .= \'<br><br>\';\r\n				$message .= \'<b>Telemóvel:</b> \' . $_POST[\'mobilephone\'];\r\n				$message .= \'<br><br>\';\r\n				$message .= \'<b>Morada:</b> \' . $_POST[\'street\'];\r\n				$message .= \'<br><br>\';\r\n				$message .= \'<b>Cód. Postal:</b> \' . $_POST[\'postcode\'];\r\n				$message .= \'<br><br>\';\r\n				$message .= \'<b>Cidade:</b> \' . $_POST[\'c