(144, 'Termos e condições', '', '<div class=\"custom\">\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: 12.0pt; mso-outline-level: 2; vertical-align: baseline;\"><strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 14.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: black; border: none windowtext 1.0pt; mso-border-alt: none windowtext 0cm; padding: 0cm; mso-ansi-language: EN-GB; mso-fareast-language: PT;\" lang=\"EN-GB\">Our commitment</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal; vertical-align: baseline;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 14.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: black; border: none windowtext 1.0pt; mso-border-alt: none windowtext 0cm; padding: 0cm; mso-ansi-language: EN-GB; mso-fareast-language: PT;\" lang=\"EN-GB\">Your loyalty to PROTOTYPE Bicycle Racing Parts is regarded as one of our most valuable brand assets. To earn it, we constantly search for the best method(s) to improve performance, whether it involves manufacturing, technical support and sales. At PROTOTYPE Bicycle Racing Parts we are proud of our total in-house manufacturing process, which allows us to control each aspect of manufacturing – from the moment the idea occurs, to defining the concept and design, followed by rigorous testing.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal; vertical-align: baseline;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 14.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: black; border: none windowtext 1.0pt; mso-border-alt: none windowtext 0cm; padding: 0cm; mso-ansi-language: EN-GB; mso-fareast-language: PT;\" lang=\"EN-GB\">This allows us to produce high-tech bike components of superior quality and performance advantages. If you are having challenges with one of our products, we stand behind it and will do our best to get you back on your bike as soon as possible – backed by a limited warranty.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 5.0pt; line-height: normal; vertical-align: baseline;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 14.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: black; border: none windowtext 1.0pt; mso-border-alt: none windowtext 0cm; padding: 0cm; mso-ansi-language: EN-GB; mso-fareast-language: PT;\" lang=\"EN-GB\">For all other matters that might prevent you from riding with PROTOTYPE components, no need to worry, we will seek a solution to get you back on the road or trail as fast as possible.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal; vertical-align: baseline;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 14.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: black; mso-ansi-language: EN-GB; mso-fareast-language: PT;\" lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: 12.0pt; mso-outline-level: 2; vertical-align: baseline;\"><strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 14.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: black; border: none windowtext 1.0pt; mso-border-alt: none windowtext 0cm; padding: 0cm; mso-ansi-language: EN-GB; mso-fareast-language: PT;\" lang=\"EN-GB\">Limited Warranty</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal; vertical-align: baseline;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 14.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-fami