wtext 0cm; padding: 0cm; mso-ansi-language: EN-GB; mso-fareast-language: PT; mso-no-proof: yes;\" lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: 12.0pt; mso-outline-level: 2; vertical-align: baseline;\"> </p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 5.0pt; line-height: normal; vertical-align: baseline;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 14.0pt; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: black; border: none windowtext 1.0pt; mso-border-alt: none windowtext 0cm; padding: 0cm; mso-ansi-language: EN-GB; mso-fareast-language: PT;\" lang=\"EN-GB\">This warranty is void in its entirety by any modification of the product by a non-authorized dealer. This warranty is expressly limited to the repair or replacement of a defective item, and said repair or replacement is the sole remedy of the warranty. This warranty extends from the date of purchase, is offered only to the original owner, and is non-transferable. This warranty applies only to PROTOTYPE products purchased through an authorized dealer or distributor. PROTOTYPE Bicycle Racing Parts is not responsible for incidental or consequential damages. Some states in the U.S. do not allow the exclusion of incidental or consequential damages, so the above exclusion may not apply to you. Any claim against this warranty must be made through an authorized dealer or distributor. Proof of purchase is required. PROTOTYPE products must be registered with PROTOTYPE Bicycle Racing Parts before a warranty claim may be processed. Claims made outside the country of purchase may be subject to fees and additional restrictions. Warranty duration and detail may differ by country. This warranty gives you specific legal rights, and those rights may vary from place to place. This warranty does not affect your statutory rights. The English version of the warranty shall prevail.</span></p>\r\n</d