(147, 'Privacy', '', '<p class=\"MsoNormal\" style=\"text-align: center; line-height: normal;\" align=\"center\"><strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; mso-ansi-language: EN-GB;\" lang=\"EN-GB\">PRIVACY POLICY</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">Rivo Performance Parts, Lda in compliance with current legislation regarding the protection of personal data. We are committed to ensuring that your information is secure. In order to prevent unauthorized access or disclosure, we have put in place suitable physical, electronic and managerial procedures to safeguard and secure the information we collect online.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">Rivo Performance Parts, Lda, in compliance with current legislation regarding the protection of personal data (LO 15/199 from December 13, the Protection of Personal Data, and RD 1720/2007, from December 21, which evolved from Law 15/1999, from December 13, regarding the protection of personal data) and with the requirement of confidentiality for its own activities, make known the existence of a personal data file called CLIENTS AND/OR SUPPLIERS, owned by Rivo Performance Parts, Lda with the aim to manage CLIENTS AND/OR SUPPLIERS. If you do not want the actions indicated above to take effect, please do not provide us with your data.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">In any case, the consent may be revoked by sending an email to sales@prototype.pt (this may involve terminating the relationship between company and/or supplier).</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">Rivo Performance Parts, Lda, has taken the measures necessary to maintain the required level of security, depending on the nature of the personal data and the circumstances regarding treatment of such data, in order to avoid, as much as possible through technical measures, the alteration, loss, or unauthorized access to data.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">The moment that a relationship is established between the CUSTOMER AND/OR SUPPLIER and Rivo Performance Parts, Lda, the collection of some data will be required for the provision of services. Likewise, additional information to be given voluntarily may be solicited for the purposes of information and marketing services. If there are blank fields to be completed by the user, they will be used to obtain information to improve service or products; data revealing ideology, union affiliation, religion, beliefs, health, racial origin or sexual preference will not be solicited.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">In order for the information contained in our files to be current and free of errors, we ask our customers and users to inform us at their earliest convenience, changes and corrections to their personal data. The data provided by the user will be deemed accurate, otherwise it must communicated that data is inaccurate or incomplete so that data can be updated.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">The user gives his/her consent so that Rivo Performance Parts, Lda can make use of personal information (captured from navigating the Internet) to transmit (via browser or software) third-party advertising (according to the websites visited) that may be useful in relation to the services solicited from Rivo Performance Parts, Lda.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">In the event that the services are to be used by minors, prior consent by parents or guardians must be given, with regard to the collection and processing of personal data, according to current legislation governing data protection.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">The user has the power to exercise his/her rights of access, rectification, cancellation and opposition to the processing of data. Personal data will be treated with absolute confidentiality, and will be used only for stated purposes and only with the expressed consent of the user.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">All private communications between Rivo Performance Parts, Lda and their CUSTOMERS AND/OR SUPPLIERS will be considered confidential, and will commit Rivo Performance Parts, Lda to secrecy, data about a person’s character, considering it a duty to protect data and take all necessary measures to prevent the alteration, loss, treatment or unauthorized access in accordance with the provisions of the Regulation on Security Measures. In addition, data will also be subjected to the condition of confidentiality of any information that the parties exchange among themselves, that these agreements will be of such nature, or simply be seen to contain such nature. Data visualization via Internet does not constitute a shortcut, unless through express consent of its owner for each and every occasion.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">Rivo Performance Parts, Lda uses cookies found in the user’s navigation habits and generates data transfer files whose information is anonymous, and whose sole purpose is to improve services to users and collect statistical information about site usage.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">Rivo Performance Parts, Lda in accordance with the Services Information Society and Electronic Commerce Law 34/2002 of July 11, conveys wide acceptance of this law and includes among these services, the provision of information by such means. In any event, it shall be applied in this regard, Law 15/1999 of December 13, Protection of Personal Data, and its implementing regulations, especially in reference to the collection of personal data, the collection of information by stakeholders, and the creation and maintenance of personal data files.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">The website www.prototype.pt has been created and is owned by Rivo Performance Parts, Lda, which assumes responsibility for the adoption of technical security measures and organizational measures to protect the confidentiality and integrity of information in accordance with the provisions of Law 15/1999 of December 13, the Protection of Personal Data and other applicable legislation.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><strong><span style=\"font-size: 12.0pt; mso-ansi-language: EN-GB;\" lang=\"EN-GB\">What we collect?</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">We may collect the following information:</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">Name, Gender, Birthday</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">Contact information including email address</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">Demographic information such as postcode, preferences and interests</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">Other information relevant to customer surveys and/or offers</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">For the exhaustive list of cookies we collect see the List of cookies we collect section.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><strong><span style=\"font-size: 12.0pt; mso-ansi-language: EN-GB;\" lang=\"EN-GB\">Security</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">We are committed to ensuring that your information is secure. In order to prevent unauthorized access or disclosure, we have put in place suitable physical, electronic and managerial procedures to safeguard and secure the information we collect online.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><strong><span style=\"font-size: 12.0pt; mso-ansi-language: EN-GB;\" lang=\"EN-GB\"> </span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><strong><span style=\"font-size: 12.0pt; mso-ansi-language: EN-GB;\" lang=\"EN-GB\">What we do with the information we gather</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">We require this information to understand your needs and provide you with a better service, and in particular for the following reasons:</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">Internal record keeping.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">We may use the information to improve our products and services.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">We may periodically send promotional emails about new products, special offers or other information which we think you may find interesting using the email address which you have provided.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">From time to time, we may also use your information to contact you for market research purposes. We may contact you by email, phone, fax or mail. We may use the information to customise the website according to your interests.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; mso-ansi-language: EN-GB;\" lang=\"EN-GB\">Controlling your personal information</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">You may choose to restrict the collection or use of your personal information in the following ways:</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">Whenever you are asked to fill in a form on the website, look for the box that you can click to indicate that you do not want the information to be used by anybody for direct marketing purposes</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">If you have previously agreed to us using your personal information for direct marketing purposes, you may change your mind at any time by writing to or emailing us at data sales@prototype.pt</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">We will not sell, distribute or lease your personal information to third parties unless we have your permission or are required by law to do so. We may use your personal information to send you promotional information about third parties which we think you may find interesting if you tell us that you wish this to happen.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">You may request details of personal information which we hold about you under the Data Protection Act 1998. A small fee will be payable. If you would like a copy of the information held on you please write to data sales@prototype.pt</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">If you believe that any information we are holding on you is incorrect or incomplete, please write to or email us as soon as possible, at the above address. We will promptly correct any information found to be incorrect.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center; line-height: normal;\" align=\"center\"><strong><span style=\"font-size: 12.0pt; mso-ansi-language: EN-GB;\" lang=\"EN-GB\">Cookies</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center; line-height: normal;\" align=\"center\"><strong><span style=\"font-size: 12.0pt; mso-ansi-language: EN-GB;\" lang=\"EN-GB\"> </span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><strong><span lang=\"EN-GB\">How we use cookies</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">We would like to remind you that cookies record certain information stored on your hard drive. This information enables us to generate statistics based on data from visitors to our site and suggest products that might interest you according to the items that you selected when you previously visited the site. Before any information is recorded, an alert message will ask you whether you would like to enable cookies, and you may refuse if you wish. Cookies do not contain any confidential information about you.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><strong><span lang=\"EN-GB\">What’s a Cookie?</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">A cookie is a small text file that a website saves on your computer or mobile device when you visit the site. It enables the website to remember your actions and preferences (such as login, language, font size and other display preferences) over a period of time, so you don’t have to keep re-entering them whenever you come back to the site or browse from one page to another.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><strong><span lang=\"EN-GB\">How we use cookies?</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">A cookie is a small file which asks permission to be placed on your computer’s hard drive. Once you agree, the file is added and the cookie helps analyse web traffic or lets you know when you visit a particular site. Cookies allow web applications to respond to you as an individual. The web application can tailor its operations to your needs, likes and dislikes by gathering and remembering information about your preferences.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">We use traffic log cookies to identify which pages are being used. This helps us analyse data about web page traffic and improve our website in order to tailor it to customer needs. We only use this information for statistical analysis purposes and then the data is removed from the system.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">Overall, cookies help us provide you with a better website, by enabling us to monitor which pages you find useful and which you do not. A cookie in no way gives us access to your computer or any information about you, other than the data you choose to share with us. You can choose to accept or decline cookies. Most web browsers automatically accept cookies, but you can usually modify your browser setting to decline cookies if you prefer. This may prevent you from taking full advantage of the website.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><strong><span lang=\"EN-GB\">Third Party Cookies?</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">These are cookies set on your machine by external websites whose services are used on this site.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">You should check the respective policies of each of these sites to see how exactly they use your information and to find out how to opt out, or delete, such information.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><strong><span lang=\"EN-GB\">Google Analytics</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">We use Google Analytics to collect information about visitor behaviour on our website. Google Analytics stores information about what pages you visit, how long you are on the site, how you got here and what you click on. This Analytics data is collected via a JavaScript tag in the pages of our site and is not tied to personally identifiable information. We therefore do not collect or store your personal information (e.g. your name or address) so this information cannot be used to identify who you are.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">You can find out more about Google’s position on privacy as regards its Analytics service at </span><a href=\"http://www.google.com/intl/en_uk/Analitycs/privacyoverview.html\"><span lang=\"EN-GB\">http://www.google.com/intl/en_uk/Analitycs/privacyoverview.html</span></a></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><strong><span lang=\"EN-GB\">How to control cookies in different browsers (enable/disable):</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">Chrome</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">Chrome para Android</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">Firefox</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">Explorer</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">Safari</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">Safari para iOS</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">Others: AllAboutCookies.org</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">You can delete all cookies that are already on your computer and you can set most browsers to prevent them from being placed. If you do this, however, you may have to manually adjust some preferences every time you visit a site and some services and functionalities may not work.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><strong><span lang=\"EN-GB\">Links to other websites:</span></strong></p>\r\n<p> </p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span lang=\"EN-GB\">Our website may contain links to other websites of interest. However, once you have used these links to leave our site, you should note that we do not have any control over that other website. Therefore, we cannot be responsible for the protection and privacy of any information which you provide whilst visiting such sites and such sites are not governed by this privacy statement. You should exercise caution and look at the privacy statement applicable to the website in question.</span></p>', 1, 'center-top', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, 'en-GB');
