(182316, 'Roda MTB Carbon 29r (F)', 'As rodas Prototype de Carbono proporcionam uma combinação entre um aro de carbono extremamente leve e raios resistentes, resultando num desempenho fenomenal.<br /><br /><br /><br />Cubo: Prototype Evo 3.1<br /><br />Rolamentos: Prototype Pro<br /><br />Raios: F-28 <br /><br />Largura aro: 24.5mm<br /><br />Raios: Pillar Aero SL - PSR<br /><br />Compatibilidade disco: Dic 6 Bolt (IS)<br /><br />Compatibilidade cepo: Shimano 10 / 11s e Sram XD<br /><br />Peso atleta: 85Kg Max<br /><br />Peso do Set: 1320Gr +/- 20Gr', 'Roda MTB Carbon 29r (F)', '', '', '', 'p74-03-012-roda-mtb-carbon-29r-f'),
