(182400, 'Roda Pro Tour 3SL SP Pneu (T)', 'PRO TOUR SL (Super Light)<br /><br />Rodas perfeitas para a maioria das ocasiões e terrenos, boas prestações, mesmo em condições de muito vento e terreno montanhoso.<br /><br />As Pro Tour 3SL são bastante reativas e leves, ótimas para subida e em competição.<br /><br /><br /><br />Pneu<br /><br />Cubo: SP1 Prototype<br /><br />Rolamentos: Prototype PRO<br /><br />Raios: T 24h <br /><br />Largura Aro (interior): 21 milímetros<br /><br />Perfil Aro: 38 milímetros<br /><br />Raios: Pilar AeroSL PSR<br /><br />Compatibilidade de Travão: Caliper<br /><br />Compatibilidade Transmissão: 10 | 11s Shimano e Campagnolo<br /><br />Atleta: 85 kg Max.', 'Roda Pro Tour 3SL SP Pneu (T)', '', '', '', 'p74-14-015-roda-pro-tour-3sl-sp-pneu-t'),
