(182438, 'Roda Joker 8 SP (F)', 'Desenvolvidas para obter o melhor desempenho aerodinâmico. O objetivo da aerodinâmica é reduzir a resistência ao vento habitualmente chamado de drag.<br /><br />A aerodinâmica de um aro de perfil maior como as Joker 8 é ideal para Contra-Relógio, Triatlo e etapas planas.<br /><br />Baixa resistência ao rolamento, rigidez excecional e baixo coeficiente de arrasto são as principais características da gama Joker.<br /><br /><br /><br />Frente Tubular:<br /><br />Cubo: SP1 Prototype<br /><br />Rolamentos: Prototype PRO<br /><br />Raios: 20H<br /><br />Largura Aro: 21 milímetros<br /><br />Perfil Aro: 88 milímetros<br /><br />Raios: Pilar Aero PSR<br /><br />Compatibilidade de Travão: Caliper<br /><br />Atleta: 100 kg Max.<br /><br />', 'Roda Joker 8 SP (F)', '', '', '', 'p74-21-001-roda-joker-8-sp-f'),
