(1, '', '<p style=\"margin-top: 0in; margin-right: 0in; margin-bottom: 15.0pt; margin-left: 0in; line-height: 11.25pt;\"> </p>\r\n<p style=\"margin-top: 0in; margin-right: 0in; margin-bottom: 15.0pt; margin-left: 0in; line-height: 11.25pt;\"><strong><span style=\"font-size: 10.5pt; font-family: \'Open Sans\', sans-serif;\">1. Produtos e Preços</span></strong></p>\r\n<p style=\"margin: 0in 0in 15pt; line-height: 11.25pt; box-sizing: border-box;\"><span style=\"font-size: 10.5pt; font-family: \'Open Sans\', sans-serif;\">1.1 Todos os preços mencionados excepto os preços PVP, não incluem IVA.</span></p>\r\n<p style=\"margin: 0in 0in 15pt; line-height: 11.25pt; box-sizing: border-box;\"><span style=\"font-size: 10.5pt; font-family: \'Open Sans\', sans-serif;\">1.2. A oferta apresentada na RacingCycle está limitada ao stock existente.</span></p>\r\n<p style=\"margin: 0in 0in 15pt; line-height: 11.25pt; box-sizing: border-box;\"><span style=\"font-size: 10.5pt; font-family: \'Open Sans\', sans-serif;\">1.3. A RacingCycle reserva-se o direito de alterar as condições de comercialização dos produtos apresentados.</span></p>\r\n<p style=\"margin: 0in 0in 15pt; line-height: 11.25pt; box-sizing: border-box;\"><span style=\"font-size: 10.5pt; font-family: \'Open Sans\', sans-serif;\">1.4. A RacingCycle faz todos os esforços para que a informação apresentada esteja isenta de erros tipográficos e, sempre que estes ocorram e sejam detectados, procederá, logo que possível, à sua correcção.</span></p>\r\n<p style=\"margin: 0in 0in 15pt; line-height: 11.25pt; box-sizing: border-box;\"><span style=\"font-size: 10.5pt; font-family: \'Open Sans\', sans-serif;\">1.5. A RacingCycle não pode ser responsabilizada no caso de se verificarem erros nos valores e/ou características dos produtos, quando estes decorrerem de problemas técnicos alheios à sua vontade. As imagens podem não corresponder ao artigo quanto ao tamanho ou cor real.</span></p>\r\n<p style=\"margin: 0in 0in 15pt; line-height: 11.25pt; box-sizing: border-box;\"><span style=\"font-size: 10.5pt; font-family: \'Open Sans\', sans-serif;\">1.6. Os preços e especificações dos produtos contidos neste site estão sujeitos a alteração sem aviso prévio.</span></p>\r\n<p style=\"margin: 0in 0in 15pt; line-height: 11.25pt; box-sizing: border-box;\"><span style=\"font-size: 10.5pt; font-family: \'Open Sans\', sans-serif;\"> </span></p>\r\n<p style=\"margin: 0in 0in 15pt; line-height: 11.25pt; box-sizing: border-box;\"><strong style=\"box-sizing: border-box;\"><span style=\"font-size: 10.5pt; font-family: \'Open Sans\', sans-serif;\">2. Garantia</span></strong></p>\r\n<p style=\"margin: 0in 0in 15pt; line-height: 11.25pt; box-sizing: border-box;\"><span style=\"font-size: 10.5pt; font-family: \'Open Sans\', sans-serif;\">2.1. Os equipamentos e acessórios adquiridos na RacingCycle têm uma garantia de 2 anos (vinte e quatro meses), salvo consumíveis ou indicação do fabricante.</span></p>\r\n<p style=\"margin: 0in 0in 15pt; line-height: 11.25pt; box-sizing: border-box;\"><span style=\"font-size: 10.5pt; font-family: \'Open Sans\', sans-serif;\">2.2. A garantia é prestada nos termos e condições estabelecidas pelo fabricante do equipamento em questão.</span></p>\r\n<p style=\"margin: 0in 0in 15pt; line-height: 11.25pt; box-sizing: border-box;\"><span style=\"font-size: 10.5pt; font-family: \'Open Sans\', sans-serif;\">2.3. Decorrido o período de garantia bem como naquelas situações em que a garantia é afastada devido à verificação de uma causa de exclusão da mesma, os custos inerentes a eventuais reparações técnicas serão por conta do Cliente.</span></p>\r\n<p style=\"margin: 0in 0in 15pt; line-height: 11.25pt; box-sizing: border-box;\"><span style=\"font-size: 10.5pt; font-family: \'Open Sans\', sans-serif;\">2.4. Para usufruir da garantia dos produtos adquiridos, deverá guardar a factura entregue no momento da recepção da sua encomenda.</span></p>\r\n<p style=\"margin: 0in 0in 15pt; line-height: 11.25pt; box-sizing: border-box;\"><span style=\"font-size: 10.5pt; font-family: \'Open Sans\', sans-serif;\"> </span></p>\r\n<p style=\"margin: 0in 0in 15pt; line-height: 11.25pt; box-sizing: border-box;\"><strong style=\"box-sizing: border-box;\"><span style=\"font-size: 10.5pt; font-family: \'Open Sans\', sans-serif;\">3. Outras Informações</span></strong></p>\r\n<p style=\"margin: 0in 0in 15pt; line-height: 11.25pt; box-sizing: border-box;\"><span style=\"font-size: 10.5pt; font-family: \'Open Sans\', sans-serif;\">3.1. Para qualquer esclarecimento adicional que considere necessário relativamente à oferta comercial aqui apresentada, por favor contacte-nos.</span></p>', '', '', '', '', 'Prototype', '', 'www.prototype.pt', '', '', '', 'prototype');
